export const searchForSongs = (song) =>
  fetch('/searchForSong', {
    method: 'POST',
    body: JSON.stringify(song),
    headers: {
      'content-type': 'application/json',
    },
    json: true,
  }).then((response) => response.results.json());

export default {
  searchForSongs,
};
